--- Constants and config ---
DEBUG          = false
DIS_RSC_CHK    = false -- Disable Resources Check
PATH_GAMED     = getGameDirectory()
PATH_MOOND     = PATH_GAMED .. '/moonloader'

PATH_FLAPPYD   = PATH_MOOND .. '/flappy'
PATH_SCORES    = PATH_FLAPPYD .. '/scores.score'

FRAME_SIZE_X   = 1284
FRAME_SIZE_Y   = 720

-- Should have aspect ratio 17x12
BIRD_SPRITE_SX = 85
BIRD_SPRITE_SY = 60

-- Should have aspect ratio 16x128(1x8)
TUBE_SPRITE_SX = 80
TUBE_SPRITE_SY = 640

-- Should have aspect ratio 1200x120(10x1)
BG_SPRITE_SX = FRAME_SIZE_X
BG_SPRITE_SY = FRAME_SIZE_Y

BIRD_POS_X     = 0.25 -- NORMALIZED
TUBE_HOLE_SIZE = 0.35 -- NORMALIZED

FRAME_TITLE    = "Flappy Bird"

UNIT_SEPARATOR = string.char(0x1F)

TICKS_PER_SECOND = 40
VELOCITY_BY_INPUT = 3.15 -- Velocity after pressing Space
TUBES_MOVE_PER_TICK = 0.002 -- NORMALIZED
VELOCITY_LOST_PER_TICK = 0.07
MIN_BIRD_ANGLE = -(math.pi / 2) -- -90 degrees
MAX_BIRD_ANGLE = math.rad(25)
MAX_HOLES_RANGE = 0.2 -- NORMALIZED
MAX_HOLE_Y = 0.8 - TUBE_HOLE_SIZE -- NORMALIZED
MIN_HOLE_Y = 0.2 -- NORMALIZED
TUBES_OFFSET_X = 0.2 -- NORMALIZED
HOLE_X_TO_REGEN = -TUBE_SPRITE_SX -- REAL
POPUP_SIZE_X = 200 -- REAL
POPUP_SIZE_Y = 120 -- REAL
MAX_RAND_TUBE_OFFSET_X = 0.08 -- NORMALIZED

TICK_WAIT = 1000 / TICKS_PER_SECOND

VELOCITY_IN_IDLE = -math.sqrt(math.deg(MAX_BIRD_ANGLE) / 6)

TUBES_COUNT = 6

KEY_FLY = VK_SPACE
KEY_PAUSE = VK_Q

--- Global ---
BG_OFFSET = 0
TITLE_SIZE = 0
StyleEditorVisible = false

new = imgui.new
ImVec2, ImVec4 = imgui.ImVec2, imgui.ImVec4

--- Score table ---
