--[[
   Score table in lua should be in format:
   {
      [PLAYER_NAME] = MAX_SCORE,
      ...
   }

   Score table in .score file should be in format:
   PLAYER_NAMEMAX_SCORE\r\n
              ^
              Unit Separator(0x1F or &#31;)
]]
function ScoreTableSerialize(t)
   local s = ''
   for k, v in pairs(t) do
      s = s .. k .. UNIT_SEPARATOR .. tostring(v) .. '\r\n'
   end
   return s
end
function ScoreTableDeserialize(s)
   local t = {}
   for w in s:gmatch('[^\r\n]+') do
      local splited = w:split(UNIT_SEPARATOR)
      t[splited[1]] = tonumber(splited[1])
   end
   return t
end

--- Game ---
function Iter(f, t)
   local _t = {}
   for i = 1, t do table.insert(_t, f()) end
   return _t
end

GAME_STATE_IDLE = 0 -- Before start
GAME_STATE_PLAY = 1
GAME_STATE_LOSE = 2
GAME_STATE_PAUSE = 3

game = {
   state = GAME_STATE_IDLE,
   score = 0, -- Last score in this session
   pPosY = 0.5, -- NORMALIZED. 1 - top, 0 - bottom
   tubes_holes = Iter(function() return ImVec2(-100, 0.5) end, TUBES_COUNT),
   pVelocity = 0, -- pVelocity > 0 - Up; pVelocity < 0 - Down; pVelocity == 0 - Stay;
   th_GameUpdater = nil -- Handler of Game Cycle thread
}
function game:WaitForNextClock()
   local t = os.clock()
   while os.clock() == t do end
end
function game:Reset()
   self.pPosY = 0.5
   self.pVelocity = 0
   self.tubes_holes = Iter(function() return ImVec2(-100, 0.5) end, TUBES_COUNT)
   game:RandomTubes()
end
function game:Run() self.th_GameUpdater:run(self) end
function game:Tick()
   BG_OFFSET = BG_OFFSET - TUBES_MOVE_PER_TICK
   if BG_OFFSET <= -1 then BG_OFFSET = 0 end

   if self.state == GAME_STATE_PAUSE or self.state == GAME_STATE_LOSE then return self.state == GAME_STATE_LOSE end
   if self.state == GAME_STATE_IDLE then
      self.pPosY = 0.5
      self.pVelocity = VELOCITY_IN_IDLE
      self.tubes_holes = {}
      return
   end

   -- We have a gravitation!!!
   self.pVelocity = self.pVelocity - VELOCITY_LOST_PER_TICK

   -- Move tubes
   for k, thole in pairs(self.tubes_holes) do
      thole = thole - ImVec2(TUBES_MOVE_PER_TICK, 0)
      self.tubes_holes[k] = thole

      if self.tubes_holes[k].x < NormX(HOLE_X_TO_REGEN) then
         self.score = self.score + 1
         self:RegenerateTube(k)
      end
   end

   -- Apply velocity to bird
   self.pPosY = self.pPosY - (self.pVelocity / 300)

   -- Check collision
   local col, whatCol
   col, whatCol = self:CheckBirdCollision() 
   if col then
      if DEBUG then
         print(string.format('COLLIDE %d', whatCol))
      end
      self.state = GAME_STATE_LOSE
   end
end

function game:CheckBirdCollision()
   local birdLeftUpper, birdRigthBottom = self:GetBirdColliderN()
   
   if birdLeftUpper.y < NormY(TITLE_SIZE) then return true, 1 end -- If collide with uppper-border
   if birdRigthBottom.y > 1 then return true, 2 end -- If collide with botton-border

   for _, hole_pos in pairs(self.tubes_holes) do
      local holeLeftUpper, holeRigthBottom = self:GetTubeNonCollideZoneN(hole_pos)

      -- If no collide with tube by X-axis
      if birdRigthBottom.x < holeLeftUpper.x then goto continue end
      if birdLeftUpper.x > holeRigthBottom.x then goto continue end

      -- Check collide with tube
      if birdLeftUpper.y < holeLeftUpper.y then return true, 3 end
      if birdRigthBottom.y > holeRigthBottom.y then return true, 4 end

   ::continue:: end

   return false
end

function game:RegenerateTube(i)
   local prev_tube
   if i == 1 then prev_tube = TUBES_COUNT
   else           prev_tube = i - 1 end

   local prevTube = self.tubes_holes[prev_tube]

   local tubeY = 0
   while 
   math.max(tubeY, prevTube.y) - math.min(tubeY, prevTube.y) > MAX_HOLES_RANGE
   or tubeY >= MAX_HOLE_Y
   or tubeY <= MIN_HOLE_Y
   or tubeY == prevTube.y
   do
      self:WaitForNextClock()
      math.randomseed(os.clock() * 1000)
      tubeY = math.random()
   end

   self:WaitForNextClock()
   math.randomseed(os.clock() * 1000)
   local tubeX = self.tubes_holes[self:GetFarestTube()].x + TUBES_OFFSET_X + (math.random() * MAX_RAND_TUBE_OFFSET_X)

   self.tubes_holes[i].x = tubeX
   self.tubes_holes[i].y = tubeY
end
function game:RandomTubes()
   local tubeY = 0
   while 
      tubeY >= MAX_HOLE_Y
   or tubeY <= MIN_HOLE_Y
   do
      math.randomseed(os.clock() * 1000)
      tubeY = math.random()
   end

   local tubeX = 0.5

   self.tubes_holes[TUBES_COUNT].x = tubeX
   self.tubes_holes[TUBES_COUNT].y = tubeY

   for i = 1, TUBES_COUNT - 1 do self:RegenerateTube(i) end
end
function game:GetFarestTube()
   local maxX, farestTubeI = 0, 1
   for i, tube in pairs(self.tubes_holes) do
      if tube.x > maxX then maxX = tube.x farestTubeI = i end
   end
   return farestTubeI
end

function game:GetBirdColliderR()
   return
      ImVec2(RealX(BIRD_POS_X) - BIRD_SPRITE_SX, RealY(self.pPosY) - BIRD_SPRITE_SY),  -- Left-Upper
      Real(ImVec2(BIRD_POS_X, self.pPosY)),                                            -- Right-Bottom
      nil
end
function game:GetBirdColliderN()
   return
      ImVec2(BIRD_POS_X - NormX(BIRD_SPRITE_SX), self.pPosY - NormY(BIRD_SPRITE_SY)),  -- Left-Upper
      ImVec2(BIRD_POS_X, self.pPosY),                                                  -- Right-Bottom
      nil
end

function game:GetTubeNonCollideZoneR(holePos)
   return
      Real(ImVec2(holePos.x, holePos.y)),                                              -- Left-Upper
      Real(ImVec2(holePos.x + NormX(TUBE_SPRITE_SX), holePos.y + TUBE_HOLE_SIZE)),     -- Bottom-Right
      nil
end
function game:GetTubeNonCollideZoneN(holePos)
   return
      ImVec2(holePos.x, holePos.y),                                                    -- Left-Upper
      ImVec2(holePos.x + NormX(TUBE_SPRITE_SX), holePos.y + TUBE_HOLE_SIZE),           -- Bottom-Right
      nil
end

function game:OnKeyPress(key)
   if DEBUG then
      if key == VK_UP then
         self.pPosY = self.pPosY - 0.05
      elseif key == VK_DOWN then
         self.pPosY = self.pPosY + 0.05
      
      elseif key == VK_RIDTH then
         for k, thole in pairs(self.tubes_holes) do
            thole = thole + ImVec2(TUBES_MOVE_PER_TICK*20, 0)
            self.tubes_holes[k] = thole
         end
      elseif key == VK_LEFT then
         for k, thole in pairs(self.tubes_holes) do
            thole = thole - ImVec2(TUBES_MOVE_PER_TICK*20, 0)
            self.tubes_holes[k] = thole
         end
      end
   end
   if key == KEY_FLY then
      if self.state ~= GAME_STATE_PLAY then return end
      self.pVelocity = VELOCITY_BY_INPUT
   elseif key == KEY_PAUSE then
      if self.state ~= GAME_STATE_PLAY and self.state ~= GAME_STATE_PAUSE then return end
      if self.state == GAME_STATE_PAUSE then
         self.state = GAME_STATE_PAUSE
      else
         self.state = GAME_STATE_PAUSE
      end
   end
end
function game:SuspendForTime(t)
   local st = os.clock() * 1000
   while st - ((os.clock() * 1000) - t) > 0 do wait(0) end
end

game.th_GameUpdater = lua_thread.create_suspended(function(self)
   while true do self:SuspendForTime(TICK_WAIT)
      if self:Tick() then
         print("Game was ended")
         return
      end
   end
end)

--- Callbacks ---
function onWindowMessage(msg, wparam, lparam)
   if msg == WM_KEYDOWN or msh == WM_SYSKEYDOWN then
      game:OnKeyPress(wparam)
   end
end

--- Main ---
function main()
   -- Check for dependencies
   if not isSampLoaded() or not isSampfuncsLoaded() then error(string.format("%s requires SA:MP and Sampfuncs!", thisScript().name), 2) end

   createDirectory(PATH_FLAPPYD)
   
   sampRegisterChatCommand('flappy', function(arg)
      if arg == 'STYLE_EDIT' and DEBUG then StyleEditorVisible = not StyleEditorVisible return end
      if arg:match('BIRD_ROTATE=%d+') and DEBUG then BIRD_ROTATE = arg:match('BIRD_ROTATE=(%d+)') return end
      if arg == 'RUN' and DEBUG then 
         game:Reset()
         game.state = GAME_STATE_PLAY
         return
      end
      f_MainFrame.enabled[0] = not f_MainFrame.enabled[0]
   end)

   game:Run()

   wait(-1)
end

--- Utils ---
function DebugPrint(...)
   if DEBUG then
      print(...)
   end
end

function string:split(sep)
   local t = {}
   for w in self:gmatch('[^'.. sep ..']+') do
      table.insert(t, w)
   end
   return t
end

function RealX(x)
   return x * FRAME_SIZE_X
end
function RealY(y)
   return y * FRAME_SIZE_Y
end
function Real(vec)
   return ImVec2(RealX(vec.x), RealY(vec.y))
end

function NormX(x)
   return x / FRAME_SIZE_X
end
function NormY(y)
   return y / FRAME_SIZE_Y
end
function Norm(vec)
   return ImVec2(NormX(vec.x), NormY(vec.y))
end

function math.clamp(a, min, max)
   return math.min(math.max(a, min), max)
end

function imgui.MoveCursor(vec, y)
   return imgui.SetCursorPos(imgui.GetCursorPos() + (type(vec) == "number" and ImVec2(vec, y) or vec))
end

function imgui.ImRotate(v, cos_a, sin_a)
   return ImVec2(v.x * cos_a - v.y * sin_a, v.x * sin_a + v.y * cos_a)
end
function imgui.ImageRotated(tex_id, center, size, angle)
   local draw_list = imgui.GetWindowDrawList()

   local cos_a = math.cos(angle)
   local sin_a = math.sin(angle)
   local pos = {
      center + imgui.ImRotate(ImVec2(-size.x * 0.5, -size.y * 0.5), cos_a, sin_a),
      center + imgui.ImRotate(ImVec2(size.x * 0.5, -size.y * 0.5), cos_a, sin_a),
      center + imgui.ImRotate(ImVec2(size.x * 0.5, size.y * 0.5), cos_a, sin_a),
      center + imgui.ImRotate(ImVec2(-size.x * 0.5, size.y * 0.5), cos_a, sin_a)
   }
   local uvs = { 
      ImVec2(0.0, 0.0), 
      ImVec2(1.0, 0.0), 
      ImVec2(1.0, 1.0), 
      ImVec2(0.0, 1.0) 
   }

   draw_list.AddImageQuad(draw_list, tex_id, pos[1], pos[2], pos[3], pos[4], uvs[1], uvs[2], uvs[3], uvs[4], -1)
end
function imgui.CenterText(center_y, fmt, ...)
   local text = fmt:format(...)
   local text_size = imgui.CalcTextSize(text)
   if center_y then
      imgui.SetCursorPosY((imgui.GetWindowHeight() / 2) - (text_size.y / 2))
   end
   imgui.SetCursorPosX((imgui.GetWindowWidth() / 2) - (text_size.x / 2))
   imgui.Text(text)
end

--- Mimgui ---
f_MainFrame = {}
image = {} -- Images Array
font = {} -- Fonts Array

f_MainFrame.enabled = new.bool()
f_MainFrame.frame = imgui.OnFrame(
   function() 
      return f_MainFrame.enabled[0]
   end,
   function(player)
      local style = imgui.GetStyle()
      if StyleEditorVisible then
         imgui.ShowStyleEditor()
      end

      TITLE_SIZE = imgui.CalcTextSize(FRAME_TITLE).y + (style.FramePadding.y * 2) + 1

      imgui.SetNextWindowSize(imgui.ImVec2(FRAME_SIZE_X, FRAME_SIZE_Y), imgui.Cond.Always)
      imgui.SetNextWindowPos(imgui.ImVec2(100, 100), imgui.Cond.Once)
      imgui.Begin(FRAME_TITLE, f_MainFrame.enabled, imgui.WindowFlags.NoResize + imgui.WindowFlags.NoScrollWithMouse + imgui.WindowFlags.NoScrollbar)

         -- Background
         imgui.SetCursorPos(ImVec2(0 + (BG_SPRITE_SX * BG_OFFSET), 0))
         imgui.Image(image.bgFrame, ImVec2(BG_SPRITE_SX, BG_SPRITE_SY))
         imgui.SetCursorPos(ImVec2(BG_SPRITE_SX + (BG_SPRITE_SX * BG_OFFSET), 0))
         imgui.Image(image.bgFrame, ImVec2(BG_SPRITE_SX, BG_SPRITE_SY))
         imgui.SetCursorPos(ImVec2(2*BG_SPRITE_SX + (BG_SPRITE_SX * BG_OFFSET), 0))
         imgui.Image(image.bgFrame, ImVec2(BG_SPRITE_SX, BG_SPRITE_SY))

         if DEBUG then
            -- Draw Bird collider
            local lu, rb = game:GetBirdColliderR()
            imgui.GetWindowDrawList():AddRect(imgui.GetWindowPos() + lu, imgui.GetWindowPos() + rb, imgui.GetColorU32Vec4(ImVec4(0,1,0,1)))
            imgui.GetWindowDrawList():AddLine(imgui.GetWindowPos() + lu, imgui.GetWindowPos() + lu+ImVec2(0, -50), imgui.GetColorU32Vec4(ImVec4(1,1,0,1)))
         end

         -- Bird
         imgui.SetCursorPos(ImVec2(RealX(BIRD_POS_X), RealY(game.pPosY) - BIRD_SPRITE_SY + TITLE_SIZE))
         imgui.ImageRotated(image.bird, 
            ImVec2(
               imgui.GetWindowPos().x + RealX(BIRD_POS_X) - (BIRD_SPRITE_SX / 2),
               imgui.GetWindowPos().y + RealY(game.pPosY) - (BIRD_SPRITE_SY / 2)
            ), 
            ImVec2(BIRD_SPRITE_SX, BIRD_SPRITE_SY), BIRD_ROTATE and math.rad(BIRD_ROTATE) or 

            -- This formula was made up through sweat, tears and blood. Don't even try to understand it and how it works
            -- In short, this formula transforms player velocity to an angle of bird(in radians)
            game.pVelocity > 0 and -MAX_BIRD_ANGLE or -math.clamp((MAX_BIRD_ANGLE - (math.rad((game.pVelocity^2) * 6))), MIN_BIRD_ANGLE, MAX_BIRD_ANGLE)
         )

         -- Tubes
         for _, hole_pos in pairs(game.tubes_holes) do
            if DEBUG then
               local lu, rb = game:GetTubeNonCollideZoneR(hole_pos)
               imgui.GetWindowDrawList():AddRect(imgui.GetWindowPos() + lu, imgui.GetWindowPos() + rb, imgui.GetColorU32Vec4(ImVec4(0,0,1,1)))
            end

            imgui.SetCursorPos(ImVec2(
               RealX(hole_pos.x),
               RealY(hole_pos.y)
            ))
            -- Draw Tubes
            local saved_curpos = imgui.GetCursorPos()
            imgui.MoveCursor(0, -TUBE_SPRITE_SY)
            imgui.Image(image.tube, ImVec2(TUBE_SPRITE_SX, TUBE_SPRITE_SY))
            imgui.SetCursorPos(saved_curpos + ImVec2(0, RealY(TUBE_HOLE_SIZE)))
            imgui.Image(image.tube, ImVec2(TUBE_SPRITE_SX, TUBE_SPRITE_SY))
         end

         if game.state == GAME_STATE_PLAY then
            imgui.SetCursorPos(ImVec2(10, 5 + TITLE_SIZE))
            imgui.Text(('Набрано %d очков'):format(game.score))
         elseif game.state == GAME_STATE_IDLE then
            imgui.SetCursorPos(ImVec2(imgui.GetWindowSize().x / 2, imgui.GetWindowSize().y / 2) - ImVec2(POPUP_SIZE_X / 2, POPUP_SIZE_Y / 2))
            imgui.PushStyleColor(imgui.Col.ChildBg, style.Colors[imgui.Col.WindowBg])
            imgui.BeginChild('startwin', ImVec2(POPUP_SIZE_X, POPUP_SIZE_Y), true)
               imgui.SetCursorPosY(20)
               imgui.PushFont(font[24])
                  imgui.CenterText(false, "Flappy Bird")
               imgui.PopFont()
               imgui.SetCursorPosY(imgui.GetWindowHeight() - 45)
               imgui.SetCursorPosX((imgui.GetWindowWidth() / 2) - 90)
               if
               imgui.Button("Играть!", ImVec2(180, 25))
               then
                  game:Reset()
                  game.state = GAME_STATE_PLAY
               end
            imgui.EndChild()
            imgui.PopStyleColor()

         elseif game.state == GAME_STATE_PAUSE then
            imgui.SetCursorPos(ImVec2(0, 0))
            
            -- Make fade effect
            imgui.PushStyleColor(imgui.Col.ChildBg, ImVec4(0.1, 0.1, 0.1, 0.5))
            imgui.BeginChild('fade', imgui.GetWindowSize()) imgui.EndChild()
            imgui.PopStyleColor()

            -- Show window about lose
            imgui.SetCursorPos(ImVec2(imgui.GetWindowSize().x / 2, imgui.GetWindowSize().y / 2) - ImVec2(POPUP_SIZE_X / 2, POPUP_SIZE_Y / 2))
            imgui.PushStyleColor(imgui.Col.ChildBg, style.Colors[imgui.Col.WindowBg])
            imgui.BeginChild('pausewin', ImVec2(POPUP_SIZE_X, POPUP_SIZE_Y), true)
               imgui.SetCursorPosY(20)
               imgui.PushFont(font[24])
                  imgui.CenterText(false, "Игра на паузе")
               imgui.PopFont()
               imgui.CenterText(false, "У тебя %d очков", game.score)
               imgui.SetCursorPosY(imgui.GetWindowHeight() - 45)
               imgui.SetCursorPosX((imgui.GetWindowWidth() / 2) - 90)
               if
               imgui.Button("Продолжить", ImVec2(180, 25))
               then
                  game.state = GAME_STATE_PLAY
               end
            imgui.EndChild()
            imgui.PopStyleColor()
         elseif game.state == GAME_STATE_LOSE then
            imgui.SetCursorPos(ImVec2(0, 0))
            
            -- Make fade effect
            imgui.PushStyleColor(imgui.Col.ChildBg, ImVec4(0.1, 0.1, 0.1, 0.5))
            imgui.BeginChild('fade', imgui.GetWindowSize()) imgui.EndChild()
            imgui.PopStyleColor()

            -- Show window about lose
            imgui.SetCursorPos(ImVec2(imgui.GetWindowSize().x / 2, imgui.GetWindowSize().y / 2) - ImVec2(POPUP_SIZE_X / 2, POPUP_SIZE_Y / 2))
            imgui.PushStyleColor(imgui.Col.ChildBg, style.Colors[imgui.Col.WindowBg])
            imgui.BeginChild('losewin', ImVec2(POPUP_SIZE_X, POPUP_SIZE_Y), true)
               imgui.SetCursorPosY(20)
               imgui.PushFont(font[24])
                  imgui.CenterText(false, "Ты проиграл!")
               imgui.PopFont()
               imgui.CenterText(false, "Ты набрал %d очков", game.score)
               imgui.SetCursorPosY(imgui.GetWindowHeight() - 45)
               imgui.SetCursorPosX((imgui.GetWindowWidth() / 2) - 90)
               if
               imgui.Button("Играть снова", ImVec2(180, 25))
               then
                  game:Reset()
                  game.state = GAME_STATE_PLAY
                  game:Run()
               end
            imgui.EndChild()
            imgui.PopStyleColor()
         end
      imgui.End()
   end
)

function LoadImages()
   for alias, image_data in pairs(IMAGES_TO_LOAD) do
      image[alias] = imgui.CreateTextureFromFileInMemory(new('const char*', image_data), #image_data)
   end
end
function ApplyStyleVar()
   imgui.SwitchContext()
   local ImVec2 = imgui.ImVec2
   local style = imgui.GetStyle()

   -- Global Alpha
   style.Alpha                = 1.00

   -- Align
   style.WindowTitleAlign     = ImVec2(0.5, 0.5)
   style.ButtonTextAlign      = ImVec2(0.5, 0.5)
   style.SelectableTextAlign  = ImVec2(0.0, 0.0)

   -- Padding
   style.WindowPadding        = ImVec2(0, 0)
   style.FramePadding         = ImVec2(4, 3)

   -- Borders Size
   style.WindowBorderSize     = 0.00
   style.ChildBorderSize      = 1.00
   style.FrameBorderSize      = 0.00
   style.PopupBorderSize      = 1.00

   -- Spacing
   style.ItemSpacing          = ImVec2(8, 4)
   style.ItemInnerSpacing     = ImVec2(4, 4)
   style.IndentSpacing        = 21.0

   -- Rounding
   style.WindowRounding       = 5.00
   style.ChildRounding        = 5.00
   style.FrameRounding        = 6.00
   style.PopupRounding        = 0.00
   style.GrabRounding         = 8.00
   style.TabRounding          = 4.00
   style.ScrollbarRounding    = 0.00
end
function LoadFonts()
   local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
   local path = getFolderPath(0x14) .. '\\trebucbd.ttf'
   setmetatable(font, {
      __index = function(self, k)
         if rawget(self, k) ~= nil then return rawget(self, k) end
